<script>
export default {
	name: 'seats-layout',
	components: {
	
	},	
	props: {
		isDatePicked: {
			type: Boolean,
			default: false,
		},
		isTimePicked: {
			type: Boolean,
			default: false,
		},
	},
	data: () => ({
		maxHeight: 0,
		selectedSeat: false,
		value: '',
		pickedSeats: [],
		empty: true,
		isTickeTypeSelected: false,
		tickets: ['','', ' '],
		seatsNew: [
			{
				id: '1a',
				price: [2134, 1500, 6000],
				value: '',
			},
			{
				id: '2a',
				price: [3000, 1500, 6000],
				value: '',
			},
			{
				id: '3a',
				price: [3000, 1500, 6000],
				value: '',
			},
			{
				id: '4a',
				price: [3000, 1500, 6000],
				value: '',
			},
			{
				id: '1b',
				price: [3000, 1500, 6000],
				value: '',
			},
			{
				id: '2b',
				price: [3000, 1500, 6000],
				value: '',
			},
			{
				id: '3b',
				price: [3000, 1500, 6000],
				value: '',
			},
			{
				id: '4b',
				price: [3000, 1500, 6000],
				value: '',
			},
		]
	}),
	created() {
		window.addEventListener("resize", this.onResize);
	},
	destroyed() {
		window.removeEventListener("resize", this.onResize);
	},
	methods: {
		test(e) {
			return false;
		},
		
		onBuyClick() {
			if (!this.isDatePicked || !this.isTimePicked) {
				this.$message({message: '   ', type: 'error'})
				document.querySelector('.filterBtns').scrollIntoView({block: "center", behavior: "smooth"});
			}
			let grad = true;
			if (this.pickedSeats.length < 1 && this.isTimePicked && this.isDatePicked) this.$message({message: '  ', type: 'error'});
			this.pickedSeats.forEach((element) => {
				if (element.value === "" && this.isTimePicked && this.isDatePicked) {
					const selectId = this.$refs[`ticketSelectWrap-${element.id}`];
					const select = this.$refs[`ticketSelect-${element.id}`];
					if (grad) {
						this.$message({message: '  ', type: 'error'})
						select[0].visible=true;
						selectId[0].scrollIntoView({block: "center", behavior: "smooth"});
					}
					grad = false;	
				}
			});
		},
		
		localStr(a) {
			if (a === undefined) {
				return a;
			} else {
				return a.toLocaleString("ru");
			}
		},

		onResize(a,b,c) {
			if (document.documentElement.clientWidth < 768) {
				return `${a}, ${b},  ${this.localStr(c)} .`;
			} else {
				return a;
			}
		},

		seatCheck() {
			if (!this.seatsNew) return null;

			const { number, floor } = this.$store.state.box;

			return this.seatsNew.find((item) => {
				return item.number === number && item.floorId === `${floor}`;
			});
		},
		setMaxHeight() {
			if(this.pickedSeats.length > 0) {
				(document.documentElement.clientWidth < 768) ? this.maxHeight = this.pickedSeats.length*80 : this.maxHeight = this.pickedSeats.length*100;
			} else {
				this.maxHeight = 0;
			}
		},

		pickedValue() {
			this.pickedSeats.forEach((element) => {
				if( element.value !== "") {
					return true;
				} else {
					return false;
				}
			});
		},

		placeClick({ target  }) {
			if (!this.seatsNew) return null;
			this.pickedValue();	
			
			const grand = target.parentElement.parentElement;

			if (grand.classList.contains('seat') && !grand.classList.contains('chosen')) {
				const seatNumber = target.id;
				grand.classList.add('chosen');

				const it = this.seatsNew.find((item) => {
					return item.id === target.id;
					return item.value = "1";
					//item.value='0';
				});
				this.pickedSeats.push(it);
				this.setMaxHeight();
				this.empty = false;
				return it;
				
			}
		},

		deleteClick(index, seat, event) {
			document.getElementById(seat.id).classList.remove('chosen');
			//event.target.parentElement.setAttribute('data-aos', 'zoom-in');
			this.selectedSeat = true;
			event.target.parentElement.classList.remove('aos-animate');
			const self = this;

			if (document.documentElement.clientWidth < 500) {
				this.selectedSeat = false;
				this.pickedSeats.splice(index, 1);
				this.setMaxHeight();
			} else {
				setTimeout(() => {
					self.$refs.costSpan.classList.remove('aos-animate');
					this.selectedSeat = false;
					this.pickedSeats.splice(index, 1);
					this.setMaxHeight();
					console.log(this.pickedSeats.length)
					if (this.pickedSeats.length == 0) {
						this.empty = true;
					}
				}, 800);
			}
		}
	},
	computed: {

        total() {
			if (!this.pickedSeats) return 0;
			return this.pickedSeats.reduce(function (total, item) {
				let finalPrice;
				if (typeof total !== 'undefined') {
					finalPrice = parseInt(total.toString().replace(/\s/g,'')) + Number( item.price[item.value]);
				} else {

				}

				if (finalPrice === parseInt(finalPrice, 10)) {
					return `${finalPrice.toLocaleString("ru")} .`;
				} 
			}, '0 .');
		},
		
		totalType() {
			if (typeof(this.total) !== 'undefined') {
				return true;
			} else {
				return false;
			}
		}
	},
	mounted() {
		const seatsWrap = document.querySelectorAll('#ship > g > g');
		const seats = document.querySelectorAll('[id^="seat__text"]');
		
		for(let a=0; a<seatsWrap.length; a++) {
			seatsWrap[a].classList.add('seat');
			seatsWrap[a].setAttribute('index', a);
		}
		
		for(let i=0; i<seats.length; i++) {
			const seat = seats[i];
			seat.classList.add('seat__text');
			const idx = seat.querySelector('path').id.split("_");
			seat.querySelector('path').parentElement.parentElement.id = `${idx[1]}${idx[0].toLowerCase()}`;
			const attr = seat.querySelector('path').parentElement.parentElement.querySelector('rect').id = `${idx[1]}${idx[0].toLowerCase()}`;
		}

 		//const shipImg = document.getElementsByClassName('shipWrap')[0].offsetHeight - 5;
		const shipSVG = document.querySelector('.shipWrap svg').getBBox();
		document.getElementsByClassName('seatsLayout__ship')[0].style.height = `${shipSVG.height}px`;
	},
}
</script>

